import CloudHostingImage from '../../../assets/Images/'

export default function HeaderSection() {
    return (
        <div className='main'>
            <Header />
            <Row>
                <Col className='bgMain' lg={9} md={9}>
                    <h5 className='headingTime'>Its time to give your business</h5>
                    <h1 className='headingSpin'> A Future Spin </h1>
                </Col>
                <Col lg={3} md={3}>
                    <img src={{ CloudHostingImage }} alt='CloudHosting' />
                </Col>
            </Row >


        </div>
    )
}
